import React from 'react';
import banner from '../assets/images/Banner1.png'; // Chemin relatif vers l'image
import logo from '../assets/images/logo.png';

const Home = () => {
  return (
    <div>
      <img src={logo} alt="Kasa logo" />
      <img src={banner} alt="Kasa banner" />
    </div>
  );
};

export default Home;
